import React from 'react'
import { Link, useLocation } from "react-router-dom";
import Footer_Background from './assets/Footer_Background.png';
import fb_icon from './assets/fb_icon.png';
function Footer( props ) {
    const location = useLocation();
    let url = "https://www.facebook.com/shubhim1"
    return (
        <div>
            <footer class="footer-shadow" style = {{ backgroundImage: `url(${Footer_Background})`,}}>
               <div class="container">
                    <div class="row justify-content-md-center">

                            <div class="row">

                                    <a href={url}  target="_blank"><img class = "link_pic" src={fb_icon}/></a>

                            </div>

                    </div>
               </div>

            </footer>
        </div>
    )
}

export default Footer
